import {BrowserRouter as Router,Link,Switch,Route} from 'react-router-dom';
import CreatePosts from './component/CreatePosts';
import AllPosts from './component/AllPosts';

function App() {
  return (
    <Router>
    <div>
        <nav>
          <Link to='/createPosts'><span className='PostNav'>Create the post</span></Link>
          <span className='PostNav'>All Posts</span>
          </nav>
        <div id='aboutApp'>
          this social app created developer from Ukraine his name are Artem Ivanov
        </div>
        <Switch>
      <Route path='/createPosts'>
          <CreatePosts/>
      </Route>
    </Switch>
    </div>

    </Router>
  );
}

export default App;
